import { ListOfReposContainer , Repo} from "../reposContainer/styles"
import { Section, UserAvatar, UserLogin } from "./styles"



function UserFollowers  (props)  {


    return (
        <Section>
                <UserLogin> </UserLogin>
                    <ListOfReposContainer>
                    {(props?.followers).map(follower => (

console.log(follower),
<Repo  key={follower?.id}>
    <a  href={follower?.html_url} target="_blank">{follower?.name}</a>
    <p>{follower?.description}</p>
    
</Repo>
))}
                    </ListOfReposContainer>
                <UserAvatar></UserAvatar>
        </Section>
    )
}

export default UserFollowers
